import './styles.css'; // Import your custom styles

const Carousel = () => {
  return (
    <div id="carouselExampleSlidesOnly" className="carousel slide" data-ride="carousel">
      <div className="carousel-inner">
        <div className="carousel-item active">
          <img src="" className="d-block w-100" alt="Library Management" />
          <div className="carousel-caption d-none d-md-block">
            <h5>Online Library Management</h5>
            <p>Effectively manage, track, and perform daily library operations with ease!</p>
            <button className="btn btn-primary">Login as Admin</button>
            <button className="btn btn-secondary">User Login</button>
          </div>
        </div>
        {/* Add more carousel items as needed */}
      </div>
    </div>
  );
};

export default Carousel;
